// 
// The method   double fitx::MDF(double *x)
// 
double fitx::MDF(double *x) {
  double returnValue = fitx::gDMean;
  int    i = 0, j = 0, k = 0;
  for (i = 0; i < fitx::gNCoefficients ; i++) {
    // Evaluate the ith term in the expansion
    double term = fitx::gCoefficient[i];
    for (j = 0; j < fitx::gNVariables; j++) {
      // Evaluate the polynomial in the jth variable.
      int power = fitx::gPower[fitx::gNVariables * i + j]; 
      double p1 = 1, p2 = 0, p3 = 0, r = 0;
      double v =  1 + 2. / (fitx::gXMax[j] - fitx::gXMin[j]) * (x[j] - fitx::gXMax[j]);
      // what is the power to use!
      switch(power) {
      case 1: r = 1; break; 
      case 2: r = v; break; 
      default: 
        p2 = v; 
        for (k = 3; k <= power; k++) { 
          p3 = p2 * v;
          p3 = 2 * v * p2 - p1; 
          p1 = p2; p2 = p3; 
        }
        r = p3;
      }
      // multiply this term by the poly in the jth var
      term *= r; 
    }
    // Add this term to the final result
    returnValue += term;
  }
  return returnValue;
}

